c
c         Plane wave quadrature weights
cc
        subroutine hwts3(ier,iprec,rk,cxs,cws,n)
        implicit real *8 (a-h,o-z)
        real *8 cx(1000),cy(1000)
        complex *16 cxs(*),cws(*)
        complex *16 rk,ima
        dimension xs(10 000), ws(10 000)
        data ima/(0.0d0,1.0d0)/
c
c       
c       This subroutine returns the nodes and weights for 
c       the exponential representation 
c
c       exp(ima*rk*sqrt(u^2+v^2)/sqrt(u^2+v^2) = 
c       \int_0^{+\infty} exp(-sqrt(t^2-rk^2)*t) J_0(tv) t/sqrt(t^2-rk^2) dt
c
c       u in [1,4], v in [0, 4*sqrt(2)]
c
c       All tables are valid in 
c
c       rk range [0, 4*pi] \times [0, 4*pi]
c
c
c
c       Note that 12 digit table is correct to 12 digits only in region
c       approximately [0, 1.5 pi] x [0, 1.5 pi]. Beyond that, only 10 digit
c       accuracy is achieved. In order to get full 12 digit accuracy, this 
c       table will need to be recalculated in extended precision 
c
c
c       Input parameter:
c       
c       iprec - precision required:
c           iprec = 0 - 2 digits
c           iprec = 1 - 3 digits
c           iprec = 2 - 6 digits
c           iprec = 3 - 9 digits
c           iprec = 4 - 12 digits
c
c       Output parameters:
c
c       n - the number of nodes
c       cxs - the nodes: complex *16 (n)
c       cws - the weights: complex *16 (n)
c
c
        done=1
        pi=4*atan(done)
c
        nx=11
        ny=11
c
        cx(1)=0.00d0
        cx(2)=0.02d0
        cx(3)=0.04d0
        cx(4)=0.10d0
        cx(5)=0.20d0
        cx(6)=0.40d0
        cx(7)=1.00d0
        cx(8)=pi/2
        cx(9)=pi
        cx(10)=2*pi
        cx(11)=3*pi
        cx(12)=4*pi
        cx(13)=5*pi
        cx(14)=6*pi
        cx(15)=7*pi
        cx(16)=8*pi
        cx(17)=9*pi
        cx(18)=10*pi
        cx(19)=11*pi
        cx(20)=12*pi
        cx(21)=13*pi
        cx(22)=14*pi
        cx(23)=15*pi
        cx(24)=16*pi
c
        cy(1)=0.00d0
        cy(2)=0.02d0
        cy(3)=0.04d0
        cy(4)=0.10d0
        cy(5)=0.20d0
        cy(6)=0.40d0
        cy(7)=1.00d0
        cy(8)=pi/2
        cy(9)=pi
        cy(10)=2*pi
        cy(11)=3*pi
        cy(12)=4*pi
        cy(13)=5*pi
        cy(14)=6*pi
        cy(15)=7*pi
        cy(16)=8*pi
        cy(17)=9*pi
        cy(18)=10*pi
        cy(19)=11*pi
        cy(20)=12*pi
        cy(21)=13*pi
        cy(22)=14*pi
        cy(23)=15*pi
        cy(24)=16*pi
        n = 0
c
        ier = 0
c       
        call hwts3getd(ier,rk,nx,ny,cx,cy,iquad,ix,iy)
c
ccc        write(*,*) 'iquad=*', iquad
ccc        pause
c
        if( iprec .eq. 0 ) 
     $     call hwts3p0(iquad,xs,ws,n)
c
        if( iprec .eq. 1 ) 
     $     call hwts3p1(iquad,xs,ws,n)
c
        if( iprec .eq. 2 ) 
     $     call hwts3p2(iquad,xs,ws,n)
c
        if( iprec .eq. 3 ) 
     $     call hwts3p3(iquad,xs,ws,n)
c
        if( iprec .eq. 4 ) 
     $     call hwts3p4(iquad,xs,ws,n)
c
        do 1200 k=1,n
c
        xmin=0
        xmax=100
        call linmap0(xs(k),u,uweight,xmin,xmax)
ccc           if( dble(rk) .gt. 1d0 ) then
ccc           xmid=dble(rk)
ccc           call linmap1(xs(k),u,uweight,xmin,xmax,xmid)
ccc           endif
c
        gamma=2
        v=u/(1+gamma*abs(dble(-ima*rk)))
        cxs(k)=u-ima*rk+abs(imag(-ima*rk))*ima*(v/(1+v))
        cws(k)=1+abs(imag(-ima*rk))*ima*((1+v)-v)/(1+v)**2
     $     /(1+gamma*abs(dble(-ima*rk)))
        cws(k)=cws(k)*ws(k)*uweight
c
 1200   continue
c
        return
        end
c
        subroutine hwts3iquad(ier,iprec,rk,iquad,cxs,cws,n)
        implicit real *8 (a-h,o-z)
        real *8 cx(1000),cy(1000)
        complex *16 cxs(*),cws(*)
        complex *16 rk,ima
        dimension xs(10 000), ws(10 000)
        data ima/(0.0d0,1.0d0)/
c
c       
c       This subroutine returns the nodes and weights for 
c       the exponential representation 
c
c       exp(ima*rk*sqrt(u^2+v^2)/sqrt(u^2+v^2) = 
c       \int_0^{+\infty} exp(-sqrt(t^2-rk^2)*t) J_0(tv) t/sqrt(t^2-rk^2) dt
c
c       u in [1,4], v in [0, 4*sqrt(2)]
c
c       All tables are valid in 
c
c       rk range [0, 4*pi] \times [0, 4*pi]
c
c
c
c       Note that 12 digit table is correct to 12 digits only in region
c       approximately [0, 1.5 pi] x [0, 1.5 pi]. Beyond that, only 10 digit
c       accuracy is achieved. In order to get full 12 digit accuracy, this 
c       table will need to be recalculated in extended precision 
c
c
c       Input parameter:
c       
c       iprec - precision required:
c           iprec = 0 - 2 digits
c           iprec = 1 - 3 digits
c           iprec = 2 - 6 digits
c           iprec = 3 - 9 digits
c           iprec = 4 - 12 digits
c
c       iquad: the domain number obtained from hwts3getd
c
c       Output parameters:
c
c       n - the number of nodes
c       cxs - the nodes: complex *16 (n)
c       cws - the weights: complex *16 (n)
c
c
        done=1
        pi=4*atan(done)
c
        if( iprec .eq. 0 ) 
     $     call hwts3p0(iquad,xs,ws,n)
c
        if( iprec .eq. 1 ) 
     $     call hwts3p1(iquad,xs,ws,n)
c
        if( iprec .eq. 2 ) 
     $     call hwts3p2(iquad,xs,ws,n)
c
        if( iprec .eq. 3 ) 
     $     call hwts3p3(iquad,xs,ws,n)
c
        if( iprec .eq. 4 ) 
     $     call hwts3p4(iquad,xs,ws,n)
c
cc        call prinf('n=*',n,1)
cc        call prin2('xs=*',xs,n)
cc        call prin2('ws=*',ws,n)
c
        do 1200 k=1,n
c
        xmin=0
        xmax=100
        call linmap0(xs(k),u,uweight,xmin,xmax)
ccc           if( dble(rk) .gt. 1d0 ) then
ccc           xmid=dble(rk)
ccc           call linmap1(xs(k),u,uweight,xmin,xmax,xmid)
ccc           endif
c
        gamma=2
        v=u/(1+gamma*abs(dble(-ima*rk)))
        cxs(k)=u-ima*rk+abs(imag(-ima*rk))*ima*(v/(1+v))
        cws(k)=1+abs(imag(-ima*rk))*ima*((1+v)-v)/(1+v)**2
     $     /(1+gamma*abs(dble(-ima*rk)))
        cws(k)=cws(k)*ws(k)*uweight
c
 1200   continue
c
        return
        end
c
c
c
c
        subroutine linmap0(t,u,w,ax,bx)
        implicit real *8 (a-h,o-z)
c
c       this subroutine contructs a linear mapping from interval
c       [0,1] to [ax,bx] 
c        
        u=ax+t*(bx-ax)
        w=(bx-ax)
c
        return
        end
c
c
c
c
c
c
        subroutine linmap1(t,u,w,ax,bx,cx)
        implicit real *8 (a-h,o-z)
c
c       this subroutine contructs a piecewise linear mapping from interval
c       [0,1] to [ax,bx], such that [0,0.5]->[ax,cx], [0.5,1]->[cx,bx]
c        
        if( t .le. 0.5d0 ) then
        u=ax+2*t*(cx-ax)
        w=2*(cx-ax)
        endif
c
        if( t .gt. 0.5d0 ) then
        u=cx+2*(t-0.5d0)*(bx-cx)
        w=2*(bx-cx)
        endif
c
        return
        end
c
c
c
c
c

        subroutine hwts3getd(ier,rk,nx,ny,cx,cy,iquad,ix,iy)
        implicit real *8 (a-h,o-z)
        complex *16 ima,rk
        dimension cx(*),cy(*)
        data ima/(0.0d0,1.0d0)/
c
c       rk range [0, 4*pi] \times [0, 4*pi]
c
        rkrea=dble(rk)
        rkima=imag(rk)
c
        ier = 0
c
        ix=0
        do 1200 i=1,nx+1
        if( rkrea .ge. cx(i+1) ) ix=i+1
 1200   continue
c
 1300   continue
c
        iy=0
        do 2200 i=1,ny+1
        if( rkima .ge. cy(i+1) ) iy=i+1
 2200   continue
c
 2300   continue
c
        if( ix .gt. nx ) ier = 4
        if( iy .gt. ny ) ier = 4
c       
        if( ix .eq. 0 ) ix = 1
        if( iy .eq. 0 ) iy = 1
c
        if( ix .gt. nx ) ix = nx
        if( iy .gt. ny ) iy = ny
c
        iquad = iy + (ix-1) * ny
c
c
ccc        stop
c
        return
        end
